import React from 'react'
import { Component } from 'react'
import fondmarin from './images/fondmarin.jpg'
import foret from './images/foret.jpg'
import montagne from './images/montagne.jpg'
import plage from './images/plage.jpg'
import ville from './images/ville.jpg'



class Wishes extends Component {
    constructor(props){
        super(props)
        this.state = {
          fondmarin : false,
          foret : false,
          montagne : false,
          plage : false,
          ville : false,
        }
      }


      render (){ 
        return (
            <div className="Wishes">
                <h2>Pendant cette période de confinement, il est difficile de s'évader. Où voulez-vous vous échapper ?</h2>

                <div className="cols">

                    <div className="col1">
                        <h1>Fonds Marins</h1>


                    <h1>Forêt</h1>

                    </div>

                    <div className="col2">
                        <h1>Montagne</h1>



                        <h1>Plage</h1>

                    </div>

                    <div className="col3">
                        <h1>Ville</h1>

                    </div>
                </div>
            </div>
        );
    }}


    export default Wishes;

